void Timer(void*) {
  if(Playing==false) return;
int i=(int)RTime->value();
i--;
SetLabel();
RTime->value(i);
if(i==0){
  Playing=false;
  OpenCells();
  fl_beep(FL_BEEP_ERROR);
  Loose *dlg=new Loose();
  dlg->show(); 
}

Fl::repeat_timeout(1.0, Timer);
}

void SetLabel() {
  if(TimeL) {
  sprintf(Buf3,"Remaining Time : %d",(int)RTime->value());
  RTime->label(Buf3);
}

sprintf(Buf4,"Remaining Cells : %d",(int)KHucre->value()-nBush);
KHucre->label(Buf4);
}
